const Navbar = (props) => {
  let HtmlNavbar = (
    <div className="h-screen flex flex-col justify-center items-center">
      <div>
        <h1 className="text-9xl text-primary">42</h1>
        <p className="text-4xl">PELICULAS</p>
      </div>
      <div>{props.component}</div>
    </div>
  );
  return HtmlNavbar;
};

export default Navbar;
